import React from 'react';
import './navbar.css';
import HomeIcon from '@mui/icons-material/Home';
import InfoIcon from '@mui/icons-material/Info';
import ContactEmergencyIcon from '@mui/icons-material/ContactEmergency';
import Person3Icon from '@mui/icons-material/Person3';
import { useHistory } from 'react-router-dom';

export default function Navbar() {
  const history = useHistory();

  // Function to handle the signup button click
  const handleSignupClick = () => {
    // Navigate to the signup page
    history.push('/signup');
  };

  return (
    <div>
      <div className="navBarBox">
        <div className="navLeft">
          <span className="logo">RhythmRodz</span>
        </div>

        <div className="navRight">
          <ul>
            <li>
              <a className="active" href="Home">
                <HomeIcon className="homeIcon" />
                Home
              </a>
            </li>
            <li>
              <a href="#news">
                <InfoIcon className="homeIcon" />
                About
              </a>
            </li>
            <li>
              <a href="contact">
                <ContactEmergencyIcon className="homeIcon" />
                Contact
              </a>
            </li>
            <li className="service">
              <a href="signup">
                <HomeIcon className="homeIcon" />
                Service
              </a>
            </li>

            <button onClick={handleSignupClick} className="btn2">
              <Person3Icon className="sign" />
              Sign Up
            </button>
          </ul>
        </div>
      </div>
    </div>
  );
}
